import React, {Component, useEffect, useState} from "react";
import {useLocation, useNavigate, useParams} from "react-router-dom";
import axios, {Axios} from "axios";


const withRouter = WrappedComponent => props => {
    // const params = useParams();
    // etc... other react-router-dom v6 hooks

    const location = useLocation();
    const navigate = useNavigate();
    const params = useParams();
    return <WrappedComponent {...props} location={location} navigate={navigate} params={params} />;
    // return (
    //     <WrappedComponent
    //         {...props}
    //         params={params}
    //         // etc...
    //     />
    // );
};

export class HomePage extends Component {

   // let useNavigate1 = useNavigate("/Login");
constructor(props) {
    super(props);
    this.state = {
        name: "",
        username: this.props.id,
    }
}

    componentDidMount() {
        this.state.username = this.props.id;
        axios.get("http://localhost:3001/user/name/" + this.state.username).then(res => {
            this.state.name = res.data;
        }).catch(err => {
            console.log(err);
        });
    }



    render() {

        return (
            <div>
                <h1>{this.state.name}</h1>
                <h1>{this.state.username}</h1>
            </div>
        );

    }
}

export default withRouter(HomePage);
